import React from 'react';
import { UsuarioProvider } from './context/contextoUsuario';
import FormUsuario from './components/formUsuario';
import UserList from './components/listaUsuario';
import Estadisticas from './components/estadisticas';

const App = () => {
    const month = 3; // Marzo
    const year = 2025;

    return (
        <UsuarioProvider>
            <div style={{ padding: '2rem' }}>
                <h1>Control de Insulina</h1>
                <FormUsuario/>
                <UserList /> {/* Ya maneja usuarios internamente */}
                <Estadisticas mes={month} anio={year} />
            </div>
        </UsuarioProvider>
    );
};

export default App;
